import React from "react";
import "./Landing.scss";
import bell from "../../static/img/bell.png";

function Landing() {
    return (
        <div className="landingWrapper">
            <div className="patternBox"></div>
            <div className="bellImg">
                <img src="" alt="bell" />
            </div>
        </div>
    );
}

export default Landing;
